O lago Tuz é o segundo maior lago da Turquia, e fica na Região da Anatólia Central, 105 km a nordeste de Cônia e 150 km a sudeste de Ancara. Durante a maior parte do ano, este lago salgado e pouco profundo cobre uma área de 1 500 km². Normalmente tem 80 km de comprimento e 50 km de largura, a uma altitude de 905 m.

